import React, { useState } from "react";
import axios from "axios";
import "./App.css";

function App() {
  const [input, setInput] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError("");
    setResult(null);
    try {
      const res = await axios.post("http://localhost:5050/api/diagnose", {
        user_input: input,
      });
      setResult(res.data);
    } catch (err) {
      setError("Error connecting to backend");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app-container">
      <div className="header">
        <div className="logo">🩺</div>
        <h2>AI Diagnostic Assistant</h2>
      </div>
      <form onSubmit={handleSubmit}>
        <textarea
          placeholder="Enter patient symptoms, history, or scenario (e.g., 'A 60-year-old with chest pain and sweating...')"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          required
        />
        <button type="submit" disabled={loading}>
          {loading ? "Analyzing..." : "Analyze"}
        </button>
      </form>
      {loading && <div className="loading-spinner">Analyzing... ⏳</div>}
      {error && <div className="error-message">{error}</div>}
      {result && (
        <div className="result-card">
          <div className="result-title">Clinical Results</div>
          <div className="section-label">🩹 Parsed Symptoms</div>
          <div>{result.parsed_symptoms && result.parsed_symptoms.length > 0 ? result.parsed_symptoms.join(", ") : <span className="green-safe">None detected</span>}</div>

          {result.comorbidities && (
            <>
              <div className="section-label">🧬 Comorbidities</div>
              <div>{result.comorbidities.length > 0 ? result.comorbidities.join(", ") : <span className="green-safe">None</span>}</div>
            </>
          )}

          <div className="section-label">🩺 Top Diagnoses</div>
          <ul>
            {result.diagnoses.map((d, i) => (
              <li key={i}>{d.disease} <span style={{ color: '#888', fontSize: '0.95em' }}>(matches: {d.count})</span></li>
            ))}
          </ul>

          {result.differentials && (
            <>
              <div className="section-label">🧠 Differential Diagnoses</div>
              <ul>
                {result.differentials.length > 0 ? result.differentials.map((d, i) => (
                  <li key={i}>{typeof d === 'object' ? JSON.stringify(d) : d}</li>
                )) : <li>None</li>}
              </ul>
            </>
          )}

          <div className="section-label">💊 Treatments</div>
          <ul>
            {result.treatments.map((t, i) => (
              <li key={i}>{t.disease}: {t.treatment}</li>
            ))}
          </ul>

          {result.red_flags && result.red_flags.length > 0 && (
            <>
              <div className="section-label">🚨 Red Flags</div>
              <ul>
                {result.red_flags.map((rf, i) => (
                  <li key={i} className="red-flag">{rf}</li>
                ))}
              </ul>
            </>
          )}

          {result.guidelines && (
            <>
              <div className="section-label">📋 Guidelines</div>
              <ul>
                {Array.isArray(result.guidelines)
                  ? result.guidelines.map((g, i) => (
                      typeof g === 'object'
                        ? Object.entries(g).map(([k, v]) => <li key={k}>{k}: {v}</li>)
                        : <li key={i}>{g}</li>
                    ))
                  : typeof result.guidelines === 'object'
                    ? Object.entries(result.guidelines).map(([k, v]) => <li key={k}>{k}: {v}</li>)
                    : <li>{result.guidelines}</li>}
              </ul>
            </>
          )}

          <div className="section-label">📝 Assessment</div>
          <span className={result.assessment.urgent ? "red-flag" : "green-safe"}>
            {result.assessment.message}
          </span>
        </div>
      )}
    </div>
  );
}

export default App;
